ospace; margin: 0;\"&gt;distributed.scheduler - INFO - Close client connection: Client-27e30428-7a2d-11ed-8ba6-080038b5114a&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Close client connection: Client-27e30fc6-7a2d-11ed-8ba7-080038b5114a&lt;/p&gt;\n    \n"},"id":"1400","type":"Div"},{"attributes":{"dimensions":"width"},"id":"1269","type":"WheelZoomTool"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n        &lt;h2&gt; Duration: 20.89 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 3205 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 159.74 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 18.70 s &lt;/li&gt;\n&lt;li&gt; transfer time: 12.01 s &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.0.160:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 32 &lt;/li&gt;\n          &lt;li&gt; Threads: 768 &lt;/li&gt;\n          &lt;li&gt; Memory: 5.40 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait \nimport dask.array as da\nimport os\nimport time \n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize the Deisa \nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n#or\n# Get data descriptor as a dict of Dask array\n#arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n# Sign contract\n#arrays.validate_contract()\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.time()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.time() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"months":[0,4,8]},"id":"1521","type":"MonthsTicker"},{"attributes":{"child":{"id":"1075"},"title":"Worker Profile (administrative)"},"id":"1404","type":"Panel"},{"attributes":{"axis":{"id":"1263"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1266","type":"Grid"},{"attributes":{"fill_color":{"field":"bandwidth","transform":{"id":"1151"}},"hatch_color":{"field":"bandwidth","transform":{"id":"1151"}},"height":{"value":1},"line_color":{"field":"bandwidth","transform":{"id":"115
